    },
    {
        src: image8,
        title: "Sun shines bright",
    },
    {
        src: image9,
        title: "Sun shines bright",
    },
];

export const Gallery = (props) => {
    return (
        <>
            <div
                style={{
                    margin: "30px 0px",
                    textAlign: "center",
                    background: "#eff3f3",
                }}
                id="galeria"
            >
                <h2>Galeria</h2>
            </div>
            <Carousel images={data} />
        </>
    );
};
